Een vrouw ontmoet de man van haar dromen op vakantie, wat leidt tot een snel huwelijk. Hun geluk kan niet op, totdat ze erachter 
komen dat de buren weleens huurmoordenaars zouden kunnen zijn, die zijn ingehuurd om hen te vermoorden.
